import React from "react";
import Trellie from "../Component/Trellie/Trellie";
import trelliesObject from "../Data/trellies"
import './App.css';

class App extends React.component {

  constructor(){
    super();
    this.state = {trellies: trelliesObject}
  }

  componentDidMount(){
    this.setState({trellies: trelliesObject})
  }
  render = trellies.map(object => {
    return <Trellie key={object.id} trellie={object}/>
  });

  render(){
    return( 
      <>
        {render}
      </>
    );
  }
}

export default App;
